import React from "react";
import "./styles.scss";
import Grid from "@material-ui/core/Grid";

export default function Header() {
  return;
  <Grid
    container
    spacing={1}
    direction="row"
    justify="flex-start"
    alignItems="flex-start"
    alignContent="stretch"
    wrap="nowrap"
  ></Grid>;
}
